var avatars = [
    '<div class="js-has-popover home-pitch-misc-icons anim-transition ico1" data-content="Resumes don\'t show whether candidates can code." data-trigger="hover" data-placement="right"></div>',
    '<div class="js-has-popover home-pitch-misc-icons anim-transition ico2" data-content=" Phone interviews filter only half of candidates in the first step." data-trigger="hover" data-placement="right"></div>',
    '<div class="js-has-popover home-pitch-misc-icons anim-transition ico3" data-content="Many candidates can\'t pass a simple fizz buzz challenge." data-trigger="hover" data-placement="right"></div>',
    '<div class="js-has-popover home-pitch-misc-icons anim-transition ico4" data-content="More than half of all job applications contain inaccurate information." data-trigger="hover" data-placement="left"></div>',
    '<div class="js-has-popover home-pitch-misc-icons anim-transition ico5" data-content="Reviewing paper coding tests is developer hours wasted." data-trigger="hover" data-placement="right"></div>'
];
var current_index = 0;
var interval = window.setInterval(function() {
    if (current_index >= avatars.length)  {
        clearInterval(interval);
        return;
    }
    var inner_div = $('<div/>').hide().html(avatars[current_index]);

    $(".avatar-holder").append(inner_div);
    $(".avatar-holder div:last-child").fadeIn();
    current_index = current_index + 1;
    $('.js-has-popover').popover();
}, 500);

