$(".screenshot-text").on('show.bs.collapse', function (e) {
    $(e.target).parent().addClass("active");
});
$(".screenshot-text").on('hide.bs.collapse', function (e) {
    $(e.target).parent().removeClass("active");
});

$('#carousel-example-generic').on('slid.bs.carousel', function (e) {
    $('.screenshot-tabs li').removeClass('active');
    var index = $(e.target).find('div.carousel-inner div.item').index($(e.target).find('div.carousel-inner div.active'));
    $(e.target).find('ul.screenshot-tabs li').eq(index).addClass('active');
});

